Actionscript.script:
if(_parent.技能名 != "寸拳")
{
   _parent.动画完毕();
}
_parent.攻击呐喊();

if (_parent.已使用铁布衫 != true)
{
	var 技能防御力加成 = 0.99 + 0.08 * _parent.技能等级 + Math.min(_parent.内力/7000, 0.1);
	_parent.buff.赋值("防御力","倍率",技能防御力加成,"增益");
	//_parent.防御力 += _parent.技能防御力加成;
	var 加成比例 =  -1 + 8 * _parent.技能等级 + Math.floor(Math.min(_parent.内力/70, 10));
	_root.发布消息("防御力上升" + 加成比例 + "%！目前防御力为" + Math.floor(_parent.防御力) + "点！");
}
_parent.已使用铁布衫 = true;

_parent.刚体控制器.技能等级 = Number(_parent.技能等级);
_parent.刚体控制器.gotoAndPlay("刚体开始");
减伤率 = _parent.技能等级 * 2;
_parent.霸体减伤(减伤率);

_parent.UpdateSmallState("霸体后");

_parent.UpdateBigSmallState("技能中","震地中");
if(_root.技能浮空 == true && _parent._name == _root.控制目标)
{
   if(_parent.Z轴坐标 - _parent._y >= 30)
   {
      this.onEnterFrame = function()
      {
         if(_parent.Z轴坐标 - _parent._y >= 30)
         {
            _parent.垂直速度 += 20;
            _parent._y += _parent.垂直速度;
            if(_parent._y > _parent.Z轴坐标)
            {
               _parent._y = _parent.Z轴坐标;
            }
            stop();
         }
         else
         {
			_parent._y = _parent.Z轴坐标;
            if(_parent.flySpeed > 0)
            {
               _parent.flySpeed = 0;
            }
			落地 = true;
			_parent.浮空 = false;
			_root.技能浮空 = false;
            play();
            delete this.onEnterFrame;
         }
      };
   }
}

onClipEvent (load) {
	if (Key.isDown(_root.奔跑键) == true)
	{
		_parent.攻击时移动(50,125);
	}
	else
	{
		_parent.攻击时移动(25,50);
	}
}

onClipEvent(load){
   声音 = "";
   霰弹值 = 1;
   子弹散射度 = 0;
   发射效果 = "";
   子弹种类 = "近战子弹";
   子弹威力 = _parent._parent.空手攻击力 * (1 + _parent._parent.技能等级 * 0.2);
   子弹速度 = 0;
   击中地图效果 = "";
   Z轴攻击范围 = 30;
   击倒率 = 0;
   击中后子弹的效果 = "空手攻击火花";
   if(_parent._parent.是否为敌人 == true)
   {
      子弹敌我属性 = false;
   }
   else
   {
      子弹敌我属性 = true;
   }
   var myPoint = {x:this._x,y:this._y};
   _parent.localToGlobal(myPoint);
   _root.gameworld.globalToLocal(myPoint);
   shootX = myPoint.x;
   shootY = myPoint.y;
   _root.子弹区域shoot(声音,霰弹值,子弹散射度,发射效果,子弹种类,子弹威力,子弹速度,Z轴攻击范围,击中地图效果,_parent._parent._name,shootX,shootY,_parent._parent.Z轴坐标,子弹敌我属性,击倒率,击中后子弹的效果);
}

